 handleBackspaceKey = (event, backFocus, onFocus) => {

    const key = event.key;  
    if ((key === "Backspace" || key === "Delete") && (event.target.value === "")) {
        $(`${backFocus}`).focus()
    }
    else {
        $(`${onFocus}`).focus()
    }
 }


 

